import Text from '../data/home.json';

console.log(Text)

const Render = () => {
    return (
        <>
            <div class='container flex justify-content-center align-content-center'>
                <div className='rounded bg-white max-w-6xl p-12 leading-4'>
                    <div className='mb-3 font-bold text-4xl'>{Text.Title}</div>
                    <div className='text-lg'>{Text.Para}</div>
                </div>
            </div>
        </>
    )
}

export default Render
